.@ceonagaland  briefs media after closing of Bye-election.
@dipr_nagaland @ddnewskohima @airnews_kohima @PIBKohima 
(Posted on Twitter by @MyGovNagaland)

The Bye-Election to the 14 Southern Angami-I A/C was conducted peacefully today, 3rd November 2020 in all the polling stations.
@ceonagaland @dipr_nagaland 
(Posted on Twitter by @MyGovNagaland)

हरियाणा सरकार @mlkhattar ने हिसार जिला में किसानों को खरीफ 2019, रबी 2019-20 और रबी 2020 सीजन के दौरान ओलावृष्टि और भारी बारिश के कारण फसलों को हुए नुकसान के मुआवजे का भुगतान करने के लिए 49.87 करोड़ रुपये की मंजूरी दे दी है।
@cmohry
(Posted on Twitter by @DiprHaryana)

मरवाही विधानसभा उप निर्वाचन 2020 के अंतर्गत आज हो रहे मतदान में तृतीय लिंग मतदाता दीनबंधु काशीपुरी ने गिरवर अपने कर्तव्य का निर्वहन करते हुए अपने मताधिकार का प्रयोग किया।
@SpokespersonECI @ECISVEEP 
(Posted on Twitter by @CEOChhattisgarh)

कोविड-19 पर भारत निर्वाचन आयोग की गाइडलाइंस के अनुसार मरवाही विधानसभा उप निर्वाचन क्षेत्र के सभी मतदान केंद्रों में मतदाताओं ने अपने मताधिकार का प्रयोग किया।
झलकियां
@SpokespersonECI 
@ECISVEEP 
(Posted on Twitter by @CEOChhattisgarh)

मरवाही विधानसभा उप निर्वाचन 2020 में 63 वर्षीय बुजुर्ग श्री काशीराम पैंकरा ने जोगीसार में अपने मताधिकार का प्रयोग किया।
@SpokespersonECI @ECISVEEP 
(Posted on Twitter by @CEOChhattisgarh)

@goacm  @DrPramodPSawant discussed with officials of NABARD, Directorate of Panchayats, Solid Waste Management Corporation and Municipal Administration, the status of #toilets being built up in the State today.
@GovtofGoa builds #toilet for Goan household under a subsidized rate. 
(Posted on Twitter by @dip_goa)

मरवाही विधानसभा उप निर्वाचन 2020 में भारत निर्वाचन आयोग द्वारा कोविड-19 के संदर्भ में किए गए सुरक्षा उपायों पर भरोसा जताते हुए सुश्री चंपा मोरनी ने पूरी सुरक्षा के साथ मतदान केंद्र ग्राम टिकठी में जाकर अपने मताधिकार का प्रयोग किया।
@SpokespersonECI @ECISVEEP 
(Posted on Twitter by @CEOChhattisgarh)

